import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div id="backgroundimg">
        <div>
          <a id="title" href="localhost:3000" >
            <img src="https://i.ytimg.com/vi/WQvfEqk2qBY/maxresdefault.jpg" width="319" height="79"/>
          </a>
        </div>
        </div>
      </header>
    </div>
  );
}

export default App;
